Let x1,…,x7 be the numbers of balls in bins 1–7. Require:
- x1, x3, x5, x7 are odd ⇒ write xi = 2ai + 1 (ai ≥ 0) for i ∈ {1,3,5,7}
- x2, x4, x6 are even ⇒ write xj = 2bj (bj ≥ 0) for j ∈ {2,4,6}

Then:
(2a1+1) + (2a3+1) + (2a5+1) + (2a7+1) + 2b2 + 2b4 + 2b6 = 16
2(a1+a3+a5+a7 + b2+b4+b6) + 4 = 16
a1+a3+a5+a7 + b2+b4+b6 = 6

The number of nonnegative integer solutions to this equation in 7 variables is C(6+7−1, 7−1) = C(12,6) = 924.

\boxed{924}

